import React from "react";
import "./Header.css";

const Header = props => (
  <div className="header col 1 of 3">
    <div className="title col 2 of 3">{props.children}</div>
    <div className="scores col 3 of 3">
      Score: {props.score} Highscore: {props.highscore}
    </div>
  </div>
);

export default Header;
